import React from "react";

function Showposts(props) {
  return (
    <div>
      <div className="px-6 bg-rd text-rt">
        <div className="border border-rb bg-rd-lowbright p-2 rounded-md">
          <h5 className="text-rt-darker text-sm mb-1">
            Posted by u/name 5 hours ago
          </h5>
          <h2 className="text-2xl mb-3">Favotite Charecters</h2>
          <div className="text-sm leading-6">
            {props.body}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Showposts;
